@EU_Commission Idiots, years on and you are unable to have my Law studies validated and respected within EU borders, let alone my unemployment benefits (if at all) guaranteed across-the-board.

 40 million people on the dole &amp; stuck at home.

A scam &amp; a lie, this #EU, if ever there were some.

@EU_Commission Nice
But please.
Stop globalism.

@EU_Commission Not when people disrespect the souverenty of other countries with an over inflated view of self righteous entitlement. Shows serious lack of respect.
Unfortunately, the world is not ready for an open border policy.
A disrupt social order to remove public consensus is in play.

@EU_Commission @WeyandSabine
 And doctors in Ireland can treat patients both sides of the border.
For now.

